import * as React from 'react';
import _reduce from 'lodash-es/reduce.js';

import classNames from 'classnames';
import { memo, useRef } from 'react';
import PropTypes from 'prop-types';

import composeData, {
	FIELD_TAGS,
} from '../../composeData.js';
import deepDiff from '../../deepDiff.js';
import { useInteractiveStates } from '../useInteractiveStates.js';

import styles from './Form.module.css';


export { styles as formClasses };

export function Form({
	children,
	className,
	onDirty,
	onPristine,
	onSubmit: pOnSubmit,
	...props
}) {
	const formElm = useRef();
	const initValues = useRef(); // `useRef` to avoid needless re-renders
	const {
		pristine,
		touched,
		...is
	} = useInteractiveStates({ onDirty, onPristine });

	// form needs an `id` for buttons that live outside it in the DOM: `<button form={form.id}>`
	props.id ||= props.name;

	return (
		<form
			{...props}
			className={classNames(styles.Form, className)}
			noValidate
			onBlur={(e) => {
				if (e.target.form === formElm.current) {
					is.onBlur(e); // We only care when the blur bubbled from a field
				}
			}}
			onChange={is.onChange}
			onSubmit={(e) => {
				onSubmit(e, initValues, pOnSubmit);
				// After everything has succeeded
				is.onSubmit(e);
			}}
			ref={(el) => {
				setup(el, initValues);
				formElm.current = el;
			}}
			pristine={pristine}
			touched={touched}
		>
			{children}
		</form>
	);
}

Form.FIELD_TAGS = FIELD_TAGS;

Form.displayName = 'Form5Form';
Form.propTypes = {
	onDirty: PropTypes.func,
	onPristine: PropTypes.func,
	onSubmit: PropTypes.func.isRequired,
};

export default memo(Form);

// Exported for testing
export function onSubmit(event, initValues, cb) {
	event.preventDefault();

	if (!event.target.reportValidity()) return;

	event.stopPropagation();

	const values = _reduce(
		Array.from(event.target.elements),
		composeData,
		{ __proto__: null },
	);

	const delta = deepDiff(initValues.current, values);

	initValues.current = values; // reset starting values for potential subsequent submit

	return cb(delta, values, event);
}

// Exported for testing
export function setup(formElement, initValues) {
	if (!formElement || initValues.current) return;

	initValues.current = _reduce(
		Array.from(formElement.elements),
		composeData,
		{ __proto__: null },
	);
};

import * as React from 'react';
import classnames from 'classnames';
import PropTypes from 'prop-types';

import Group from '../Group/Group.jsx';

import styles from './Button.module.css';


export { styles as buttonClasses };

export default function Button({
	children: label,
	className,
	fluid,
	icon: Icon,
	...others
}) {
	return (
		<button
			{...others}
			className={classnames(
				styles.Button,
				className,
				{
					[styles.fluid]: fluid,
				},
			)}
		>
			{!!Icon
				? Icon
				: label
			}
		</button>
	);
}

Button.displayName = 'Form5Button';

Button.APPEARANCES = {
	AFFIRMING: 'affirming',
	BASIC: 'basic',
	DANGER: 'danger',
	PRIMARY: 'primary',
	WARNING: 'warning',
};
Button.TYPES = {
	BUTTON: 'button',
	SUBMIT: 'submit',
};
Button.VARIANTS = {
	CTA: 'cta',
	GLYPH: 'glyph',
};
Button.defaultProps = {
	appearance: Button.APPEARANCES.PRIMARY,
	fluid: false,
	type: Button.TYPES.BUTTON,
	variant: Button.VARIANTS.CTA,
};
Button.propTypes = {
	appearance: PropTypes.oneOf(Object.values(Button.APPEARANCES)),
	fluid: PropTypes.bool,
	type: PropTypes.oneOf(Object.values(Button.TYPES)),
	variant: PropTypes.oneOf(Object.values(Button.VARIANTS)),
};

Button.Group = ({ className, ...props }) => (
	<Group className={classnames(className, styles.ButtonGroup)} {...props} />
);

import * as React from 'react';
import classnames from 'classnames';
import _map from 'lodash-es/map.js';
import { PureComponent } from 'react';

import Button from '../Button/Button.jsx';

import styles from './FileInput.module.css';


export { styles as fileInputClasses };

export default class FileInput extends PureComponent {
	static defaultProps = {
		icon: (<span></span>),
		label: 'Select file(s)',
		multiple: false,
		onChange: () => {},
	}

	state = {
		previews: new Array(0),
	};

	handleChange = (e, cb) => {
		const { files } = e.target;

		if (!files?.length) return console.error('[File Preview] Files is empty');

		this.setState({
			previews: _map(files, this.handlePreviews),
		});

		cb(e, files);
	};

	handlePreviews(file) {
		const output = { __proto__: null };
		output.file = file;

		if (file.type.match('image.*')) {
			output.preview = URL.createObjectURL(file);
		}

		return output;
	};

	componentWillUnmount() {
		for (const { preview } of this.state.previews) {
			URL.revokeObjectURL(preview);
		}
	}

	render() {
		const {
			handleChange,
			props: {
				accept,
				className,
				icon,
				label,
				multiple,
				name,
				onChange,
			},
			state: {
				previews,
			},
		} = this;

		return (<>
			{!!previews.length && (
				<div className={styles.FileInputPreviews}>
					{_map(previews, ({
						file: { name },
						preview
					}) => {
						if (preview) return (
							<img
								className={styles.FileInputPreview}
								key={name}
								src={preview}
							/>
						);

						return (<p key={name}>{name}</p>);
					})}
				</div>
			)}

			<label
				className={classnames(styles.FileInput, className)}
				htmlFor={name}
			>
				<Button
					appearance={Button.APPEARANCES.BASIC}
					className={styles.FileInputButton}
					icon={icon}
				>
					{label}
				</Button>
				<input
					accept={accept}
					className={styles.FileInputControl}
					id={name}
					multiple={multiple}
					name={name}
					onChange={(e) => handleChange(e, onChange)}
					type="file"
				/>
			</label>
		</>);
	}
}

FileInput.displayName = 'Form5FileInput';

import * as React from 'react';
import classnames from 'classnames';
import _isEmpty from 'lodash-es/isEmpty.js';
import _map from 'lodash-es/map.js';
import PropTypes from 'prop-types';
import { useState } from 'react';

import { useInteractiveStates } from '../useInteractiveStates.js';

import styles from './Input.module.css';


export { styles as inputClasses };

export default function Input({
	arrangement = Input.ARRANGEMENTS.INLINE,
	as: Tag = 'input',
	className,
	fluid,
	id,
	label,
	name,
	onBlur = () => {},
	onChange = () => {},
	options,
	readOnly,
	required,
	type = 'text',
	...others
}) {
	const [error, setError] = useState('');
	const {
		pristine,
		touched,
		...is
	} = useInteractiveStates();
	const isInvalid = !!error;

	id ||= name;

	if (options) others.list = `${name}_options`;
	if (Tag === 'textarea') {
		others.rows ??= 3;
		type = null;
	}

	others.onBlur = (e) => {
		if (readOnly) return;

		is.onBlur(e);

		onBlur(e);

		if (e.target.checkValidity()) setError('');
	};

	others.onChange = (e) => {
		if (readOnly) return;

		is.onChange(e);

		let {
			checked,
			id,
			name,
			type,
			value,
		} = e.target;

		if (type === 'checkbox') value = checked;

		onChange({
			id,
			name,
			value: options?.[value] ?? value,
		}, e);

		if (isInvalid && e.target.checkValidity()) setError('');
	};

	const sharedConstraints = {
		readOnly,
		required,
	};

	const isSwitch = switchTypes.has(type);

	if (others.value === null) others.value = ''; // React has a tantrum when `value` is `null`

	return (
		<div
			arrangement={arrangement}
			className={classnames(
				styles.InputField,
				{
					[styles.Fluid]: fluid,
				},
			)}
			invalid={isInvalid ? '' : null}
			{...sharedConstraints}
			pristine={pristine}
			switch={isSwitch ? '' : null}
			touched={touched}
		>
			<div className={styles.InnerWrapper}>
				<Tag
					className={classnames(styles.Input, className)}
					name={name}
					id={id}
					onInvalid={(e) => {
						e.nativeEvent.stopImmediatePropagation();
						setError(e.target.validationMessage);
						is.onInvalid(e);
					}}
					{...sharedConstraints}
					type={type}
					{...others}
				/>
				{isInvalid && (
					<dialog
						className={styles.Error}
						data-testid="input-error"
						open
					>{error}</dialog>
				)}
			</div>
			{!!label && (<label
				className={styles.Label}
				htmlFor={id}
			>{label}</label>)}
			{!_isEmpty(options) && (
				<datalist data-testid={others.list} id={others.list}>{_map(options, (label, key) => (
					<option key={key} value={key}>{label}</option>
				))}</datalist>
			)}
		</div>
	);
};

Input.displayName = 'Form5Input';

Input.ARRANGEMENTS = {
	INLINE: 'inline',
	STACKED: 'stacked',
	STAND_ALONE: 'stand-alone',
};
Input.VARIANTS = {
	TOGGLE: 'toggle',
};
Input.propTypes = {
	arrangement: PropTypes.oneOf(Object.values(Input.ARRANGEMENTS)),
	as: PropTypes.elementType,
	fluid: PropTypes.bool,
	label: PropTypes.string,
	name: PropTypes.string.isRequired,
	onBlur: PropTypes.func,
	onChange: PropTypes.func,
	options: PropTypes.object,
	variant: PropTypes.oneOf(Object.values(Input.VARIANTS)),
};

const dtTypes = new Set([
	'date',
	'datetime',
	'datetime-local',
	'time',
]);

const switchTypes = new Set([
	'checkbox',
	'radio',
]);

import * as React from 'react';
import classnames from 'classnames';
import PropTypes from 'prop-types';

import styles from './Group.module.css';


export { styles as grouptClasses };

export default function Group({
	as: Tag = 'div',
	className,
	...others
}) {
	return (
		<Tag
			{...others}
			className={classnames(styles.Group, className)}
			role="group"
		/>
	);
}

Group.displayname = 'Form5Group';
Group.propTypes = {
	as: PropTypes.elementType,
};
